"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F174995\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Monitor serum levels of concomitant anticonvulsant therapy; suicidality (eg, suicidal thoughts, depression, behavioral changes)",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F175011\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Alpentin (ID);",
"     </li>",
"     <li>",
"      Bapex (MX);",
"     </li>",
"     <li>",
