"   <div class=\"block pha drugH1Div\" id=\"F174984\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Gabapentin is structurally related to GABA. However, it does not bind to GABA",
"     <sub>",
"      A",
"     </sub>",
"     or GABA",
"     <sub>",
"      B",
"     </sub>",
"     receptors, and it does not appear to influence synthesis or uptake of GABA. High affinity gabapentin binding sites have been located throughout the brain; these sites correspond to the presence of voltage-gated calcium channels specifically possessing the alpha-2-delta-1 subunit. This channel appears to be located presynaptically, and may modulate the release of excitatory neurotransmitters which participate in epileptogenesis and nociception.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F175004\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Variable, from proximal small bowel by L-amino transport system",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 58 &plusmn; 6 L",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: &lt;3%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: Inversely proportional to dose due to saturable absorption:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Immediate release:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     900 mg/day: 60%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     1200 mg/day: 47%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     2400 mg/day: 34%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     3600 mg/day: 33%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     4800 mg/day: 27%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Extended release: Variable; increased with higher fat content meal",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 5-7 hours; anuria 132 hours; during dialysis 3.8 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: Immediate release: 2-4 hours; extended release: 8 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Proportional to renal function; urine (as unchanged drug)",
"    </p>",
"   </div>",
