"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        A copy of the child's school records, organized chronologically",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A summary of the child's medical and developmental history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A copy of past diagnostic evaluations, including IQ tests, achievement tests, and tests of memory and language",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Copies of state and federal special education laws",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        The telephone numbers and membership lists of local or state chapters of:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        The Learning Disabilities Association of America (",
"        <a href=\"file://www.ldanatl.org\" target=\"_blank\">",
"         www.ldanatl.org",
"        </a>",
"        )",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Council for Exceptional Children (",
"        <a href=\"file://www.cec.sped.org\" target=\"_blank\">",
"         www.cec.sped.org",
"        </a>",
"        )",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
