"        <a href=\"file://www.chadd.org\" target=\"_blank\">",
"         www.chadd.org",
"        </a>",
"        )",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        National Joint Committee on Learning Disabilities (",
"        <a href=\"file://www.ldonline.org/njcld/index.html\" target=\"_blank\">",
"         www.ldonline.org/njcld/index.html",
"        </a>",
"        )",
"       </td>",
"      </tr>",
"      <tr>",
