"   <div class=\"lgnd\">",
"    The above table is a sample monitoring program. Each transplant center develops its own routine regarding the specific tests and their frequency. Some patients will need more frequent testing due to symptoms or prior abnormal values. CD3 cell counts are monitored initially following induction therapy with a polyclonal agent or alemtuzumab, but not on an ongoing basis.",
"    <div class=\"footnotes\">",
"     CBC: complete blood count; BUN: blood urea nitrogen; AST: aspartate aminotransferase (formerly SGOT); ALT: alanine aminotransferase (formerly SGPT); C2: cyclosporine level two hours post dose; CMV: cytomegalovirus; PCR: polymerase chain reaction.",
"     <br/>",
"     * A lipid panel is assessed monthly for the first few months and then every three to six months.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     The ImmuKnow assay is not used by all centers. The frequency of testing depends on the given center.",
"     <br/>",
